import { Fragment } from 'react';
import MainHeader from './MainHeader';

const Layout = (props) => {
  return (
    <Fragment>
      <MainHeader>{props.message && <div style={{ margin: '20px' }}>{props.message}</div>}</MainHeader>
      <main>{props.children}</main>
    </Fragment>
  );
};

export default Layout;
